import Carousel from 'react-bootstrap/Carousel';
import { Container } from 'react-bootstrap';
import HomeImg from '../assets/images/home.png';

export default function Home() {
  return (
	<Container className="my-4" fluid>
	    <h1 className="text-center mb-4 text-dark">Bienvenido a la Aplicaci√≥n de Inventario</h1>
	    <Carousel className="shadow-sm w-100" interval={3000} fade>
			<image className="d-block w-100" src={HomeImg} alt="Home" />
	      <Carousel.Item>
	        <Carousel.Caption>
	          <h3 className="dark">First slide label</h3>
	          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
	        </Carousel.Caption>
	
	        <Carousel.Caption>
	          <h3>Third slide label</h3>
	          <p>
	            Praesent commodo cursus magna, vel scelerisque nisl consectetur.
	          </p>
	        </Carousel.Caption>
	      </Carousel.Item>
	    </Carousel>
	</Container>
  );
}
